import React from 'react';
import "./style.css"

export default function App() {
  return (
    <>
      <div className="wra">
        <div className="box"></div>
      </div>
      <div className="wrapper">
        <div className="hour"></div>
        <div className="minute"></div>
        <div className="second"></div>
      </div>
    </>
  )
}
